import React from 'react';
import s from './NameDialog.module.css'
const NameDialog = () =>{
    return (
           <div className={s.name_dialogs}>
               <div>Mike</div>
               <div>Sasha</div>
               <div>Dima</div>
               <div>Tola</div>
               <div>Ylia</div>
           </div>
    );
}
export default NameDialog;
